    function checker($data){
        $flashvars = array();
        $data = explode("&", html_entity_decode(urldecode($data)));
        //dump($data);
        foreach($data as $d){
            list($key) = explode("=", $d);
            $flashvars[trim($key)] = getvalues($key, $d);
        }
        return $flashvars;
    }

    function checker2($data){
        $flashvars = array();
        $data = explode(";", html_entity_decode(urldecode($data)));
        //dump($data);
        foreach($data as $d){
            list($key) = explode("=", $d);
            $flashvars[trim($key)] = getvalues($key, $d);
        }
        return $flashvars;
    }

    function getvalues($attr, $value){
        return urldecode(str_replace("$attr=", "", $value));
    }

